import React from "react";
import './Advocate.css'

function Advocate() {
    return (
        <div className = "div904">
              <p class = "css-c3aatb">Advocate</p>
            <div>
              <h3> What is Advocate ?</h3>
              <p>An astronaut is a person trained by a human spaceflight program to command, pilot, or serve as a crew member of a spacecraft. Members of the space program of Russia or the Soviet Union are referred to as cosmonauts. Although generally reserved for professional space travelers, the terms are sometimes applied to anyone who travels into space, including scientists, politicians, journalists and tourists.Until 2002, astronauts were sponsored and trained exclusively by governments, either by the military or by civilian space agencies. With the suborbital flight of the privately funded SpaceShipOne in 2004, a new category of astronaut was created: the commercial astronaut.</p>
            </div>
        </div>
    );
}

export default Advocate;
